import './App.css';
import React, { Component } from 'react';
import {Hello} from './components/function';
import {Class} from './components/class';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Hello name='Danil'/>
        <Hello name='Nurislam'/>
        <Hello name='Adil'/>
        <Class name='Aytaly'></Class>
      </div>
    );
  }
}

export default App;
